import React, { useState } from 'react';
import { useNavigate} from 'react-router-dom';
import './App.css';
import Footer from "./components/Footer";
import HouseSidingRoundedIcon from '@mui/icons-material/HouseSidingRounded';
const Signup = () => {
  const navigate=useNavigate();
  const [formData, setFormData] = useState({
    email: '',
    password: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate('/login')
  };

  return (
    <div className="flex flex-col h-screen">
        <header className="header text-white text-center py-3">
            <h1 className="font-mono text-2xl font-bold"><HouseSidingRoundedIcon/>CozyQuarters</h1>
        </header>
        <div className="flex justify-center items-center h-screen">
        <form action='' className="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4 w-1/3" onSubmit={handleSubmit}>
            <h2 className="text-2xl font-bold mb-4">Sign-Up</h2>
            <div className="mb-4">
            <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="email">
                Email
            </label>
            <input
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="email"
                type="email"
                placeholder="Email"
                name="email"
                value={formData.email}
                onChange={handleChange}
            />
            </div>
            <div className="mb-6">
            <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="password">
                Password
            </label>
            <input
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 mb-3 leading-tight focus:outline-none focus:shadow-outline"
                id="password"
                type="password"
                placeholder="Password"
                name="password"
                value={formData.password}
                onChange={handleChange}
            />
            </div>
            <div className="flex items-center justify-between">
            <button
                className="stbt bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
                type="submit" 
            >
                Sign Up
            </button>
            </div>
        </form>
        <div className='ffot'><Footer/></div>
        </div>
    </div>
  );
};

export default Signup;
